import React from "react";
import "./Hero.css";

const Hero = () => {
  return (
    <div className="hero">
      <div className="row">
        <div className="col-md-6 col-12">
          <div className="content">
            <p>Call us</p>
            <p>1-800-123-4567</p>
            <p>Because Money</p>
            <p>Doesn't come with instructions</p>
            <button href="/" className="button">
              Free Consultation
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Hero;
